/*import express from "express";
import cors from "cors";
import logger from "./utils/logger";
import 'dotenv/config';*/

const express= require("express");
const cors=require('cors');
const dotenv=require('dotenv/config');
//const logger=require("./utils/logger");
const connect=require("./utils/database.connection");
import logger from "./utils/logger"
const app=express();
const PORT =process.env.PORT||"8090";

app.use(cors());
app.use(express.json({limit:"20mb"}));

const deliveryRouter=require("./api/Routes/deliveryinfos");
app.use("/deliveryinfo",deliveryRouter);

const userRouter=require("./api/Routes/userinfo");
app.use("/userinfo",userRouter);

const orderRouter=require("./api/Routes/orders");
app.use("/order",orderRouter);

app.get("/",(req,res,next)=>{
res.send("<h2>ATL Beauty store</h2>");
next();
});
app.listen(PORT, ()=> {
    console.log(`server is up and running on port ${PORT}`);
    connect();
});

